sys_variable_value.value:
(function execute(inputs, outputs) {

   var summaryTwoArray=[];

 if(inputs.status_code="200"){

 var responsebody=JSON.parse(inputs.response_body);

 for(var i=0; i<responsebody.data.length;i++){

                                              var summarytwoobj={};
                                              summarytwoobj.deathcases= responsebody.data[i].latest_data.deaths;
                                              summarytwoobj.country= responsebody.data[i].name;
                                              summaryTwoArray[i]= summarytwoobj;
                                              }
 outputs.summarytwo=summaryTwoArray;

                             }

})(inputs, outputs);

